CREATE SCHEMA IF NOT EXISTS `aslbuddy_db` DEFAULT CHARACTER SET latin1 ;
USE `aslbuddy_db` ;

-- -----------------------------------------------------
-- Table `aslbuddy_db`.`user`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `aslbuddy_db`.`user` (
  `userId` INT(11) NOT NULL AUTO_INCREMENT,
  `skypeName` VARCHAR(50) NOT NULL,
  `email` VARCHAR(50) NOT NULL,
  `isInterpreter` TINYINT(1) NOT NULL,
  `lastActiveDate` DATETIME NOT NULL,
  `inCall` TINYINT(1) NOT NULL,
  `canCall` TINYINT(1) NOT NULL,
  `passHash` VARCHAR(250) NOT NULL,
  'username' VARCHAR(50) NOT NULL,
  PRIMARY KEY (`userId`));


-- -----------------------------------------------------
-- Table `aslbuddy_db`.`activity_log`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `aslbuddy_db`.`activity_log` (
  `activityID` INT(11) NOT NULL,
  `timeDate` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `activityPerformed` VARCHAR(50) NULL DEFAULT NULL,
  `activityDetail` VARCHAR(250) NULL DEFAULT NULL,
  `activityUserId` INT(11) NULL DEFAULT NULL,
  PRIMARY KEY (`activityID`),
  INDEX `activityUserId_idx` (`activityUserId` ASC),
  CONSTRAINT `activityUserId`
    FOREIGN KEY (`activityUserId`)
    REFERENCES `aslbuddy_db`.`user` (`userId`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)


-- -----------------------------------------------------
-- Table `aslbuddy_db`.`block_table`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `aslbuddy_db`.`block_table` (
  `blockingUserId` INT(11) NULL DEFAULT NULL,
  `blockedUserId` INT(11) NULL DEFAULT NULL,
  `blockDate` DATETIME NULL DEFAULT NULL,
  INDEX `Blocking User ID_idx` (`blockingUserId` ASC),
  INDEX `Blocked User ID_idx` (`blockedUserId` ASC),
  CONSTRAINT `Blocking User ID`
    FOREIGN KEY (`blockingUserId`)
    REFERENCES `aslbuddy_db`.`user` (`userId`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `Blocked User ID`
    FOREIGN KEY (`blockedUserId`)
    REFERENCES `aslbuddy_db`.`user` (`userId`)
    ON DELETE CASCADE
    ON UPDATE CASCADE)

